INSERT INTO `letter` VALUES ('circulation','AR_CANCELED','','Article Request - Email - Canceled',0,'Article Request Canceled','<<borrowers.firstname>> <<borrowers.surname>> (<<borrowers.cardnumber>>)\r\n\r\nYour request for an article from <<biblio.title>> (<<items.barcode>>) has been canceled for the following reason:\r\n\r\n<<article_requests.notes>>\r\n\r\nArticle requested:\r\nTitle: <<article_requests.title>>\r\nAuthor: <<article_requests.author>>\r\nVolume: <<article_requests.volume>>\r\nIssue: <<article_requests.issue>>\r\nDate: <<article_requests.date>>\r\nPages: <<article_requests.pages>>\r\nChapters: <<article_requests.chapters>>\r\nNotes: <<article_requests.patron_notes>>\r\n','email'),('circulation','AR_COMPLETED','','Article Request - Email - Completed',0,'Article Request Completed','<<borrowers.firstname>> <<borrowers.surname>> (<<borrowers.cardnumber>>)\r\n\r\nWe are have completed your request for an article from <<biblio.title>> (<<items.barcode>>).\r\n\r\nArticle requested:\r\nTitle: <<article_requests.title>>\r\nAuthor: <<article_requests.author>>\r\nVolume: <<article_requests.volume>>\r\nIssue: <<article_requests.issue>>\r\nDate: <<article_requests.date>>\r\nPages: <<article_requests.pages>>\r\nChapters: <<article_requests.chapters>>\r\nNotes: <<article_requests.patron_notes>>\r\n\r\nYou may pick your article up at <<branches.branchname>>.\r\n\r\nThank you!','email'),('circulation','AR_PENDING','','Article Request - Email - Open',0,'Article Request Received','<<borrowers.firstname>> <<borrowers.surname>> (<<borrowers.cardnumber>>)\r\n\r\nWe have received your request for an article from <<biblio.title>> (<<items.barcode>>).\r\n\r\nArticle requested:\r\nTitle: <<article_requests.title>>\r\nAuthor: <<article_requests.author>>\r\nVolume: <<article_requests.volume>>\r\nIssue: <<article_requests.issue>>\r\nDate: <<article_requests.date>>\r\nPages: <<article_requests.pages>>\r\nChapters: <<article_requests.chapters>>\r\nNotes: <<article_requests.patron_notes>>\r\n\r\n\r\nThank you!','email'),('circulation','AR_PROCESSING','','Article Request - Email - Processing',0,'Article Request Processing','<<borrowers.firstname>> <<borrowers.surname>> (<<borrowers.cardnumber>>)\r\n\r\nWe are now processing your request for an article from <<biblio.title>> (<<items.barcode>>).\r\n\r\nArticle requested:\r\nTitle: <<article_requests.title>>\r\nAuthor: <<article_requests.author>>\r\nVolume: <<article_requests.volume>>\r\nIssue: <<article_requests.issue>>\r\nDate: <<article_requests.date>>\r\nPages: <<article_requests.pages>>\r\nChapters: <<article_requests.chapters>>\r\nNotes: <<article_requests.patron_notes>>\r\n\r\nThank you!','email'),('circulation','AR_SLIP','','Article Request - Print Slip',0,'Test','Article Request:\r\n\r\n<<borrowers.firstname>> <<borrowers.surname>> (<<borrowers.cardnumber>>)\r\n\r\nTitle: <<biblio.title>>\r\nBarcode: <<items.barcode>>\r\n\r\nArticle requested:\r\nTitle: <<article_requests.title>>\r\nAuthor: <<article_requests.author>>\r\nVolume: <<article_requests.volume>>\r\nIssue: <<article_requests.issue>>\r\nDate: <<article_requests.date>>\r\nPages: <<article_requests.pages>>\r\nChapters: <<article_requests.chapters>>\r\nNotes: <<article_requests.patron_notes>>\r\n','print'),('circulation','CHECKIN','','Item Check-in (Digest)',0,'Kvittering på innlevert materiale','Kvittering på innlevert materiale\r\n\r\nFølgende lån er blitt innlevert <<old_issues.returndate>>\r\n----\r\n<<biblio.title>>\r\n----\r\n\r\nTakk! \r\n\r\n','email'),('circulation','CHECKIN','','Item Check-in (Digest)',0,'Kvittering på innlevert','Kvittering på innlevert materiale\r\n\r\nFølgende lån er blitt innlevert <<old_issues.returndate>>\r\n----\r\n<<biblio.title>>\r\n----\r\n\r\nTakk! ','sms'),('circulation','CHECKOUT','','Item Check-out (Digest)',0,'Kvittering på utlånt materiale  ','Kvittering på utlånt materiale\r\n\r\nFølgende medier er lånt ut <<issues.issuedate>>\r\n----\r\n\"<<biblio.title>>\" <<items.barcode>>\r\n----\r\n