r\n<ul>\r\n   <li><<items.barcode>></li>\r\n   <li><<items.itemcallnumber>></li>\r\n</ul>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n\r\n<<branches.branchcode>>\r\n<<branches.branchname>>\r\n<<branches.branchaddress1>>\r\n\r\n<<branches.branchphone>>','print'),('members','ACCTDETAILS','','Account Details Template - DEFAULT',1,'Velkommen til Deichman','Hei <<borrowers.firstname>>,\r\n \r\n<p>og velkommen til Deichmanske bibliotek - landets best besøkte kulturinstitusjon!</p>\r\n \r\n<p>Ditt midlertidige lånenummer er <<borrowers.userid>></p>\r\n\r\n<h2>Søk</h2>\r\nNå er det bare å søke i samlingen vår på sok.deichman.no\r\n\r\n<p>Visste du at samlingen vår inneholder nesten 1,2 millioner medier?</p>\r\nNoen eksempler:\r\n<ul>\r\n<li>250 000 romaner på norsk </li>\r\n<li>57 000 filmer</li>\r\n<li>11 000 lydbøker for barn</li>\r\n<li>bøker på 60 ulike språk</li>\r\n</ul>\r\n\r\n<p>\r\nAlle bibliotekene våre har gratis trådløst nettverk og tilsammen arrangerer vi over 3000 barneforestillinger, teater, konserter, kurs og foredrag. Se https://www.deichman.no/kalender for oversikt over hva som skjer. \r\n</p>\r\n\r\n<h2>Hent bibliotekkortet ditt</h2>\r\n<p>\r\nNår du har søkt opp, funnet og reservert en bok, film eller annet fra samlingen, får du beskjed om å hente. Første gang må du huske legitimasjon, så vi får gitt deg bibliotekkortet som du trenger for henting og levering. Nummeret på kortet er ditt permanente lånenummer. </p>\r\n \r\n<h2>Bruk våre filialer</h2>\r\n<p>\r\nDeichmanske bibliotek er Norges største og eldste folkebibliotek, og består av ett hovedbibliotek i sentrum og 18 filialer over hele byen. Vi har også flere spesialavdelinger for innbyggere som trenger et tilpasset bibliotektilbud, blant annet Pasientbiblioteket på Rikshospitalet, Fengselsbibliotekene i Oslo og Biblo Tøyen for unge mellom 10 og 15 år. </p>\r\n \r\n<h2>Mine sider</h2>\r\n<p>\r\nPå sok.deichman.no/profile har du oversikten over lån og reservasjoner, dine innstillinger og annen informasjon om deg.</p>\r\n \r\n<p>\r\nDeichmanske er ditt og mitt bibliotek. Helt gratis. Vi tror på biblioteket som en møteplass for alle. Et fristed, alene eller sammen med andre.</p>\r\n\r\n<p>Vi håper du får glede av oss!</p>\r\n\r\n<p>Vennlig hilsen</p>\r\n \r\nKnut Skansen,<br/>\r\nbiblioteksjef, (konstituert)\r\n','email'),('members','DISCHARGE','','Discharge confirmation',1,'Discharge for <<borrowers.firstname>> <<borrowers.surname>>','\n<<today>>\n<h1>Discharge confirmation</h1>\n<p><<branches.branchname>> certifies that the following borrower:<br>\n<<borrowers.firstname>> <<borrowers.surname>> (cardnumber: <<borrowers.cardnumber>>)<br>\nhas returned all items.</p>','email'),('members','OPAC_REG_VERIFY','','Opac Self-Registration Verification Email',1,'Verify Your Account','Hello!\n\nYour library account has been created. Please verify your email address by clicking this link to complete the signup process:\n\n<<OPACBaseURL>>/cgi-bin/koha/opac-registration-verify.pl?token=<<borrower_modifications.verification_token>>\n\nIf you did not initiate this request, you may safely ignore this one-time message. The request will expire shortly.','email'),('members','PASSWORD_RESET','','Online password reset',1,'Koha password recovery','<html>\r\n<p>This email has been sent in response to your password recovery request for the account <strong><<user>></strong>.\r\n</p>\r\n<p>\r\nYou can now create your new password using the following link:\r\n<br/><a href=\"<<passwordreseturl>>\"><<passwordreseturl>></a>\r\n</p>\r\n<p>This link will be valid for 2 days from this email\'s reception, then you must reapply if you do not change your password.</p>\r\n<p>Thank you.</p>\r\n</html>\r\n','email'),('orderacquisition','ACQORDER','','Acquisition order',0,'Order','<<aqbooksellers.name>>\r\n<<aqbooksellers.address1>>\r\n<<aqbooksellers.address2>>\r\n<<aqbooksellers.address3>>\r\n<<aqbooksellers.address4>>\r\n<<aqbooksellers.phone>>\r\n\r\nPlease order for the library:\r\n\r\n<order>Ordernumber <<aqorders.ordernumber>> (<<biblio.title>>) (quantity: <<aqorders.quantity>>) ($<<aqorders.listprice>> each).</order>\r\n\r\nThank you,\n\n<<branches.branchname>>','email'),('reserves','HOLD','','Hold Available for Pickup',0,'Hentemelding fra biblioteket ','Hei <<borrowers.firstname>>. \r\n\r\n\"<<biblio.title>>\" kan nå hentes på <<branches.branchname>>  \r\n\r\nSiste frist for henting er <<reserves.expirationdate>>\r\n\r\nHentenummer: <<reserves.pickupnumber>>\r\n\r\nHilsen,\r\nDeichmanske bibliotek\r\n\r\n\r\n','email'),('reserves','HOLD','','Hold Available for Pickup',0,'Hold Available for Pickup (print notice)','Hei <<borrowers.firstname>>. \r\n\r\n\"<<biblio.title>>\" kan nå hentes på <<branches.branchname>>  \r\n\r\nDu har syv dager på å hente reservasjonen. \r\n\r\nHentenummer: <<reserves.pickupnumber>>\r\n\r\nHa en god dag!\r\n\r\nHilsen,\r\nDeichmanske bibliotek\r\n\r\n','print'),('reserves','HOLD','','Hold Available for Pickup',0,'Hentemelding fra biblioteket ','Hei <<borrowers.firstname>>. \r\n\r\n\"<<biblio.title>>\" kan nå hentes på <<branches.branchname>>  \r\n\r\nSiste frist for henting er <<reserves.expirationdate>>\r\n\r\nHentenummer: <<reserves.pickupnumber>>\r\n\r\nHilsen,\r\nDeichmanske bibliotek','sms'),('serial','RLIST','','Routing List',0,'Serial is now available','<<borrowers.firstname>> <<borrowers.surname>>,\r\n\r\nThe following issue is now available:\r\n\r\n<<biblio.title>>, <<biblio.author>> (<<items.barcode>>)\r\n\r\nPlease pick it up at your convenience.','email');
